import React from 'react'
import { Navbar } from 'react-bootstrap'
import logo from './assets/logo.jpg'

const Header = () => {
    return (
        <div>
            <Navbar bg="light" variant="light">
            <Navbar.Brand href="/"><Image className='logo' src={logo} alt='logo app' /></Navbar.Brand>
            </Navbar>
        </div>
    )
}
